import React from "react";


function Announcements(){
    let Announcements=['something']

    return(<div>
    
        <table>
            <tr>
                <th className="table-head"></th>
            </tr>
              {Announcements.map((item =>
                <tr><td>{item}</td>
             
              </tr> ))}
            </table>
        
        </div>
        )
    ;
;}

export default Announcements;
